import React from 'react';
import './limitations.css';
import {Container, Row, Col} from 'react-bootstrap';
import Header from '../../common/sectionHeader/sectionHeader.js';

function limitations() {
    return (
        <section className = "limitations" id = "limitations">
            <Container>
                <Header effectType = "fade-up" headerText = "Limitations" contentText = "Here is a few things you must be aware of when using our solution"></Header>
               
            </Container> 
        </section>
    )
}

export default limitations
